export default function Sidebar() {
  return (
    <div className="w-[12.5%] bg-azul-falcon text-white p-4">
      <h1 className="text-xl font-bold mb-6">HAWKEYE</h1>
      <div className="space-y-4">
        <Link to="/clientes" className="block bg-azul-falcon p-2 rounded hover:bg-naranja-falcon">Clientes</Link>
        <Link to="/clientes/nuevo" className="block bg-azul-falcon p-2 rounded hover:bg-naranja-falcon">AÃ±adir Cliente</Link>
        <Link to="/propiedades" className="block bbg-azul-falcon p-2 rounded hover:bg-naranja-falcon hover:text-azul-falcon">Propiedades</Link>
      </div>
    </div>
  );
}
